// A method to escape a string in HTML style
window.escapeHtml = function(string) {
    return string
        .replace(/&/g, "&amp;")
        .replace(/'/g, "&apos;")
        .replace(/"/g, "&quot;")
        .replace(/</g, "&lt;")
        .replace(/>/g, "&gt;");
};

window.safeParser = function(jsonString) {
    try {
        return JSON.parse(jsonString);
    } catch (e) {
        return jsonString;
    }
};
